import { useEffect, useState } from "react";
import styled from "styled-components";
import styles from '../index.css';

function Popular(){
    const [popular, setPopular] = useState([]);

    useEffect(() => {
        getPopular();
    },[]);

    const getPopular = async () => {
        const api = await fetch(`https://api.spoonacular.com/recipes/random?apiKey=b3360338f3954b3d8ab63e9ada6f4c26&number=5`);
        const data = await api.json();
        setPopular(data.recipes);
    };

    return (
        <div>
            <h3>Popular Picks</h3>
            {popular.map((recipe) => {
                return (
                <div key={recipe.id}> 
                    <p className="recipeCard">{recipe.title}</p>
                    <img className="recipeCard" src={recipe.image} alt={recipe.title} />
                </div>
            ); 
            })}
        </div>
    );
}

export default Popular;
